 data-end=\"867\">  <p data-start=\"809\" data-end=\"867\">Travel-friendly and compact for home, gym, or vacations.</p>  </li>  <li data-start=\"868\" data-end=\"920\">  <p data-start=\"872\" data-end=\"920\">Helps unclog pores and prevent skin breakouts.</p>  </li>  <li data-start=\"921\" data-end=\"994\">  <p data-start=\"925\" data-end=\"994\">Suitable for regular exfoliation to maintain healthy, glowing skin.</p>  </li>  <li data-start=\"995\" data-end=\"1056\">  <p data-start=\"999\" data-end=\"1056\">Promotes natural skin renewal and a radiant appearance.</p>  </li>  <li data-start=\"1057\" data-end=\"1111\">  <p data-start=\"1061\" data-end=\"1111\">Easy to clean and maintain for long-lasting use.</p>  </li>  <li data-start=\"1112\" data-end=\"1176\">  <p data-start=\"1116\" data-end=\"1176\">Gentle on sensitive areas while effective on tougher skin.</p>  </li>  <li data-start=\"1177\" data-end=\"1248\">  <p data-start=\"1181\" data-end=\"1248\">Perfect addition to eco-friendly and chemical-free bath routines.</p>  </li>  <li data-start=\"1249\" data-end=\"1311\">  <p data-start=\"1253\" data-end=\"1311\">Encourages self-care with a spa-like experience at home.</p>  </li>  <li data-start=\"1312\" data-end=\"1410\">  <p data-start=\"1316\" data-end=\"1410\">Achieve soft, smooth, and healthy skin every day with Midazzle Natural Loofah Body Scrubber</p>  </li>  </ul>', 1, 1, 0, 'packet', 1, 0, '10', 0, '', 0, 'pay_by_yourself', NULL, 169, '2026-01-30 12:46:57', '2026-02-18 15:42:40', NULL),
