(126, 'contact_us', '<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Contact Us</strong></span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">At bringmart.in, we value our customers and are here to assist you with any questions, feedback, or concerns. Feel free to reach out to us using the information below.</span></h4>\r\n<hr>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Customer Support</strong></span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">Our customer support team is available to assist you during the following hours:</span><br><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Monday to Saturday:</strong> 10:00 AM to 6:00 PM (IST)</span><br><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Sunday &amp; Public Holidays:</strong> Closed</span></h4>\r\n<hr>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Contact Information</strong></span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Email:</strong></span><br><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">For general inquiries: contact@bringmart.in</span><br><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">For order-related queries: support@bringmart.in</span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Phone:</strong></span><br><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">Customer Service Hotline: 0657-4022692</span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Address:</strong></span><br><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">BringMart Ecommerce Private Limited&nbsp;</span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">&nbsp;H.NO.34,Jeeta Singh Bagan,Namdabasti,Golmuri,East Singhbhum ,Jamshedpur Jharkhand ,India 831003</span></h4>\r\n<hr>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Connect with Us</strong></span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">For the latest updates, promotions, and more, follow us on:</span></h4>\r\n<ul>\r\n<li style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Facebook:</strong> bringmart</span></h4>\r\n</li>\r\n<li style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Instagram:</strong></span></h4>\r\n</li>\r\n<li style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Twitter:</strong></span></h4>\r\n</li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Frequently Asked Questions (FAQs)</strong></span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">Before reaching out, check out our&nbsp;section for quick answers to common questions about orders, returns, shipping, and more.</span></h4>\r\n<hr>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\"><strong>Feedback and Suggestions</strong></span></h4>\r\n<h4><span style=\"font-size: 14pt; font-family: georgia, palatino, serif;\">We are always looking to improve our services and appreciate your feedback. Please email us your suggestions or complaints at support<strong>@bringmart.in</strong></span></h4>'),
