(195, 'privacy_policy', '<h2>Effective Date: 01/01/24</h2>\r\n<p>At BringMart, your privacy is of utmost importance to us. This Privacy Policy outlines how we collect, use, disclose, and safeguard your information when you use our platform, including our website and mobile application (\"BringMart Platform\"). By accessing or using BringMart, you agree to the terms described in this policy.</p>\r\n<hr>\r\n<h2>1. <strong>Information We Collect</strong></h2>\r\n<p>We collect the following types of information to provide and improve our services:</p>\r\n<h3>1.1 <strong>Information You Provide Directly</strong></h3>\r\n<ul>\r\n<li><strong>Account Information</strong>: When you register, we collect your name, email address, phone number, delivery address, and payment details.</li>\r\n<li><strong>Support Requests</strong>: Information you provide when you contact our customer support team.</li>\r\n<li><strong>Reviews and Feedback</strong>: Any ratings, reviews, or comments you leave on the platform.</li>\r\n</ul>\r\n<h3>1.2 <strong>Information We Collect Automatically</strong></h3>\r\n<ul>\r\n<li><strong>Device Information</strong>: Details about your device, including the device type, operating system, browser type, and IP address.</li>\r\n<li><strong>Location Information</strong>: Precise geolocation data to fulfill orders and estimate delivery times.</li>\r\n<li><strong>Usage Data</strong>: Information about how you interact with our app or website, such as pages visited, features used, and time spent.</li>\r\n</ul>\r\n<h3>1.3 <strong>Information from Third Parties</strong></h3>\r\n<ul>\r\n<li><strong>Payment Processors</strong>: Transaction details when you make purchases through our platform.</li>\r\n<li><strong>Social Media</strong>: If you link your BringMart account with a social media platform, we may collect relevant profile information as permitted by that platform.</li>\r\n</ul>\r\n<h2>2. How We Use Your Information</h2>\r\n<p>We use the information we collect to provide, enhance, and personalize your experience on the BringMart platform. Specifically, we use your information to:</p>\r\n<ul>\r\n<li><strong>Process Your Orders</strong>: Ensure accurate and timely order fulfillment, including delivery to your specified location.</li>\r\n<li><strong>Improve Our Services</strong>: Analyze usage trends to enhance the functionality and user experience of our app and website.</li>\r\n<li><strong>Communicate with You</strong>: Send order updates, promotional offers, service announcements, and respond to your inquiries or feedback.</li>\r\n<li><strong>Ensure Security</strong>: Protect your account and our platform against fraud, unauthorized access, and other security threats.</li>\r\n<li><strong>Personalize Your Experience</strong>: Provide recommendations and tailored content based on your preferences and previous interactions.</li>\r\n<li><strong>Comply with Legal Obligations</strong>: Adhere to applicable laws, regulations, and legal processes, including responding to government or legal requests.</li>\r\n</ul>\r\n<p>By using your information responsibly, we strive to deliver a seamless and secure shopping experience.</p>\r\n<h2>3. How We Share Your Information</h2>\r\n<p>We value your privacy and only share your information in ways that are necessary to operate and enhance our services. Specifically, we may share your information with:</p>\r\n<ul>\r\n<li><strong>Service Providers</strong>: Third-party vendors, such as delivery partners, payment processors, and customer support providers, who help us deliver products and services to you.</li>\r\n<li><strong>Business Partners</strong>: Collaborators who assist us in offering promotions, discounts, or co-branded services, subject to applicable data protection laws.</li>\r\n<li><strong>Legal and Regulatory Authorities</strong>: When required to comply with applicable laws, legal processes, or government requests, or to protect the rights, safety, and property of BringMart, its users, or the public.</li>\r\n<li><strong>Corporate Transactions</strong>: In the event of a merger, acquisition, or sale of all or part of our business, your information may be transferred as part of that transaction.</li>\r\n</ul>\r\n<p>We do not sell or rent your personal information to third parties for marketing purposes. Any sharing of information is conducted with your privacy and security in mind, and we ensure that our partners adhere to strict confidentiality and data protection standards.</p>\r\n<h2>4. Your Choices and Rights</h2>\r\n<p>At BringMart, we believe in empowering you to make informed decisions about your personal information. You have the following choices and rights regarding your data:</p>\r\n<ul>\r\n<li><strong>Access and Review</strong>: You can request access to the personal information we hold about you and review it for accuracy.</li>\r\n<li><strong>Update or Correct</strong>: You have the right to update or correct any inaccuracies in your personal information through your account settings or by contacting us.</li>\r\n<li><strong>Delete Your Information</strong>: You can request the deletion of your personal information, subject to legal and operational requirements, by reaching out to us via the provided contact details.</li>\r\n<li><strong>Manage Marketing Preferences</strong>: You can opt out of receiving promotional communications by updating your preferences in your account settings or by following the unsubscribe instructions included in our communications.</li>\r\n<li><strong>Restrict Processing</strong>: In certain situations, you may request to restrict the processing of your personal information, such as if you contest its accuracy or object to its processing.</li>\r\n<li><strong>Data Portability</strong>: You have the right to request a copy of your personal information in a portable format, where technically feasible.</li>\r\n<li><strong>Withdraw Consent</strong>: If we process your personal information based on your consent, you can withdraw that consent at any time, though this may affect your ability to use certain features of our platform.</li>\r\n<li><strong>Lodge a Complaint</strong>: If you believe we have violated your rights, you have the right to lodge a complaint with a relevant data protection authority.</li>\r\n</ul>\r\n<p>We are committed to respecting your rights and ensuring transparency. To exercise any of these rights or for assistance, please contact us at the email address or support channel provided in this privacy policy. Note that some rights may be subject to certain limitations as required or permitted by applicable laws.</p>\r\n<h2>5. Data Retention</h2>\r\n<p>At BringMart, we retain your personal information only for as long as necessary to fulfill the purposes outlined in this Privacy Policy, such as providing our services, complying with legal obligations, resolving disputes, and enforcing our agreements. The specific retention period for your data depends on factors such as the type of information, the purpose for which it was collected, and applicable legal or regulatory requirements.</p>\r\n<p>For instance:</p>\r\n<ul>\r\n<li><strong>Account Information</strong>: We retain your account information as long as your account is active. If you choose to deactivate or delete your account, we will retain your information only to the extent necessary to comply with legal obligations or for legitimate business purposes, such as fraud prevention or dispute resolution.</li>\r\n<li><strong>Transaction Records</strong>: Information related to purchases, deliveries, and payments may be retained for audit, tax, and accounting purposes for the duration required by law.</li>\r\n<li><strong>Marketing Preferences</strong>: We retain your preferences and opt-out requests to ensure we respect your choices in future communications.</li>\r\n</ul>\r\n<p>When your personal information is no longer necessary for the purposes for which it was collected, we will securely delete, anonymize, or otherwise dispose of it in accordance with applicable laws and best practices. If deletion is not feasible due to technical or operational constraints, we will ensure your data is securely stored and isolated from further processing until deletion becomes possible.</p>\r\n<p>We strive to implement appropriate safeguards to ensure that your data remains secure throughout its retention period and is handled in compliance with applicable laws and regulations.</p>\r\n<h2>6. Security of Your Information</h2>\r\n<p>At BringMart, the security of your personal information is a top priority. We implement a variety of industry-standard security measures to protect your data from unauthorized access, disclosure, alteration, or destruction. These measures include secure encryption protocols, firewalls, access controls, and regular security assessments to ensure that your data remains safe at all times.</p>\r\n<p>While we strive to use commercially acceptable means to protect your personal information, no method of transmission over the internet or method of electronic storage is 100% secure. Therefore, we cannot guarantee absolute security. However, we continuously monitor our systems for vulnerabilities and potential threats and take immediate action to address any issues.</p>\r\n<p>We also encourage you to play a role in safeguarding your information. Protect your account credentials, avoid sharing sensitive information over unsecured networks, and contact us immediately if you suspect any unauthorized activity on your account. By working together, we can help ensure the security of your information and maintain your trust.</p>\r\n<h2>7. Children&rsquo;s Privacy</h2>\r\n<p>BringMart is not intended for use by individuals under the age of 13. We do not knowingly collect or solicit personal information from children under 13 without verifiable parental consent. If we become aware that we have inadvertently collected personal information from a child under 13, we will take immediate steps to delete such information from our records.</p>\r\n<p>If you are a parent or guardian and believe that your child has provided us with personal information without your consent, please contact us at the details provided below. We encourage parents and guardians to monitor their children\'s online activities and guide them on the safe and responsible use of the internet.</p>\r\n<h2>8. Cookies and Tracking Technologies</h2>\r\n<p>BringMart uses cookies and similar tracking technologies to enhance your experience on our platform, understand user behavior, and improve our services. Cookies are small text files stored on your device that help us recognize you and remember your preferences, such as login details, shopping cart items, and language settings.</p>\r\n<p>We may also use tracking technologies like web beacons, pixels, and analytics tools to gather data about your interactions with our platform, such as pages visited, time spent, and links clicked. This information helps us optimize our website and app, deliver personalized recommendations, and display relevant advertisements.</p>\r\n<p>You can control or disable cookies through your browser or device settings, but please note that certain features of our platform may not function properly without cookies. By using our platform, you consent to the use of cookies and tracking technologies as described in this policy.</p>\r\n<h2>9. Third-Party Links</h2>\r\n<p>BringMart may contain links to third-party websites, services, or applications that are not owned or controlled by us. These links are provided for your convenience and may direct you to external platforms with their own privacy practices and policies. We do not endorse or take responsibility for the content, privacy policies, or practices of any third-party services.</p>\r\n<p>We encourage you to review the privacy policies of these third parties before providing them with any personal information. BringMart is not liable for any actions or omissions by such third-party platforms, and your interactions with them are solely at your own risk.</p>\r\n<h2>10. International Users</h2>\r\n<p>BringMart operates primarily within [insert country/region] and is subject to its laws and regulations. If you are accessing or using our app or website from outside this region, please be aware that your information may be transferred to, stored, and processed in a country where data protection laws may differ from those in your jurisdiction. By using BringMart, you consent to the transfer and processing of your information in accordance with this Privacy Policy.</p>\r\n<p>We are committed to protecting your personal information regardless of where it is processed. However, international users should ensure they understand their rights under their local data protection laws and how they interact with BringMart\'s practices. If necessary, we comply with additional requirements imposed by international data protection laws where applicable.</p>\r\n<h2>11. Changes to This Privacy Policy</h2>\r\n<p>We reserve the right to update or modify this Privacy Policy at any time to reflect changes in our practices, technology, or legal requirements. Any updates or changes will be posted on this page with the revised effective date indicated at the top of the policy. We encourage you to review this Privacy Policy periodically to stay informed about how we are protecting your information.</p>\r\n<p>If we make significant changes that materially affect the way we collect, use, or share your personal information, we will notify you through appropriate channels, such as within the app, via email, or through a prominent notice on our website. By continuing to use our services after such changes are made, you acknowledge and agree to the updated Privacy Policy.</p>'),
