(200, 'about_us', '<p><span style=\"font-size: 16pt;\">Welcome to <strong>BringMart</strong>, your go-to home delivery platform for all your daily essentials. Whether you\'re looking for fresh groceries, household items, or everyday necessities, we\'ve got you covered. With just a click, your products are delivered right to your doorstep.</span></p>\r\n<p><span style=\"font-size: 16pt;\">Our mission is to simplify your shopping experience by bringing the essentials of life to you quickly and efficiently. We understand the value of time, and that\'s why we are dedicated to making your life easier by offering a seamless, fast, and reliable service. BringMart is here to take care of your needs, allowing you to focus on what truly matters.</span></p>\r\n<p><span style=\"font-size: 16pt;\">Join us and experience the convenience of having everything you need delivered in no time.</span></p>'),
