(211, 'privacy_policy_delivery_boy', '<p><strong>Privacy policies</strong></p>\r\n<p>Introduction<br><br>Welcome to Bringmart Delivery Partner. We respect your privacy and are committed to protecting your personal data. This privacy policy will inform you about how we look after your personal data when you use our delivery partner application and tell you about your privacy rights.<br><br>1. Data We Collect<br><br>We collect and process the following types of information:<br>Personal Information: Name, mobile number, email address, date of birth, and profile photo<br>Identity Documents: Aadhaar card, PAN card, driving license, vehicle registration certificate<br>Location Data: Real-time location tracking during deliveries for route optimization and customer tracking<br>Financial Information: Bank account details, payment history, earnings records<br>Device Information: Device model, operating system, unique device identifiers, mobile network information<br>Usage Data: Delivery history, order details, app usage patterns, interaction data</p>\r\n<p><br>2. How We Use Your Data</p>\r\n<p><br>We use your personal data for the following purposes:<br>To verify your identity and eligibility as a delivery partner<br>To facilitate delivery assignments and order management<br>To process payments and maintain financial records<br>To track deliveries and provide real-time updates to customers<br>To communicate important updates, notifications, and support messages<br>To improve our services and app performance<br>To comply with legal obligations and prevent fraudulent activities</p>\r\n<p><br>3. Data Sharing and Disclosure</p>\r\n<p><br>We may share your personal data with:<br>Customers, to enable them to track deliveries and contact you<br>Payment processors and financial institutions for payment processing<br>Service providers who assist in app operations and analytics<br>Law enforcement or regulatory authorities when required by law</p>\r\n<p><br>4. Data Security</p>\r\n<p><br>We implement appropriate technical and organizational measures to protect your personal data against unauthorized access, alteration, disclosure, or destruction. This includes encryption, secure servers, and regular security audits.</p>\r\n<p><br>5. Data Retention</p>\r\n<p><br>We retain your personal data for as long as necessary to provide our services and comply with legal obligations. When you delete your account, we will delete or anonymize your personal data within 30 days, except where we are required to retain it for legal or regulatory purposes.</p>\r\n<p><br>6. Your Rights</p>\r\n<p><br>You have the following rights regarding your personal data:<br>Right to access your personal data<br>Right to correct inaccurate or incomplete data<br>Right to delete your personal data<br>Right to withdraw consent for data processing<br>Right to data portability</p>\r\n<p><br>7. Location Tracking</p>\r\n<p><br>Our app uses GPS to track your location during deliveries. This helps optimize delivery routes and allows customers to track their orders in real-time. You can disable location services at any time through your device settings, but this may affect your ability to accept and complete deliveries.<br>8. Cookies and Tracking Technologies<br>We use cookies and similar tracking technologies to improve app functionality, analyze usage patterns, and personalize your experience. You can manage cookie preferences through your device settings.</p>\r\n<p><br>9. Changes to This Policy</p>\r\n<p><br>We may update this privacy policy from time to time. We will notify you of any significant changes through the app or via email. Your continued use of the app after changes constitutes acceptance of the updated policy.</p>'),
(212, 'terms_conditions_delivery_boy', '<p>Terms and conditions for delivery boy:</p>\r\n<p><br>Introduction<br>Welcome to Bringmart Delivery Partner. These Terms and Conditions govern your use of the Bringmart Delivery Partner application and your relationship with Bringmart as a delivery partner. By registering and using our services, you agree to be bound by these terms.<br>1. Acceptance of Terms<br>By accessing or using the Bringmart Delivery Partner app, you acknowledge that you have read, understood, and agree to be bound by these Terms and Conditions. If you do not agree with any part of these terms, you must not use our services.<br>2. Eligibility Requirements<br>To become a Bringmart delivery partner, you must:<br>Be at least 18 years of age<br>Possess a valid government-issued identification (Aadhaar, PAN)<br>Hold a valid driving license and vehicle registration (for vehicle-based delivery)<br>Have a valid bank account for receiving payments<br>Own a smartphone with internet connectivity<br>3. Independent Contractor Status<br>As a delivery partner, you are an independent contractor and not an employee of Bringmart. You have the freedom to choose when and how often you work. Bringmart does not provide employment benefits such as minimum wage, overtime, insurance, or other benefits available to employees.<br>4. Delivery Partner Responsibilities<br>As a delivery partner, you agree to:<br>Accept and complete delivery orders in a timely and professional manner<br>Maintain accurate location tracking during deliveries<br>Handle customer orders with care and ensure safe delivery<br>Maintain professional conduct with customers and merchants<br>Keep your vehicle and delivery equipment in good working condition<br>Follow all traffic laws and safety regulations<br>Maintain valid insurance for yourself and your vehicle<br>5. Payment and Earnings<br>Delivery partners earn money based on completed deliveries. Earnings are calculated based on distance, time, and demand. Bringmart reserves the right to adjust pricing and commission structures with prior notice. Payments are processed according to the payment schedule communicated through the app.<br>You are responsible for any applicable taxes on your earnings as an independent contractor.<br>6. Account Security<br>You are responsible for maintaining the confidentiality of your account credentials. You must not share your account with others. Any activity performed using your account will be your responsibility. Notify us immediately if you suspect unauthorized access to your account.<br>7. Prohibited Activities<br>You must not:<br>Use the app for any illegal or unauthorized purpose<br>Manipulate or interfere with the app\'s functionality<br>Engage in fraudulent activities or create fake deliveries<br>Harass, threaten, or discriminate against customers or staff<br>Use multiple accounts to circumvent platform rules<br>Collect customer information for unauthorized purposes<br>8. Suspension and Termination<br>Bringmart reserves the right to suspend or terminate your account at any time for violations of these terms, fraudulent activities, poor performance, or other legitimate business reasons. You may also terminate your account at any time through the app settings.<br>Upon termination, you must complete any pending deliveries and will receive payment for completed work according to the standard payment schedule.<br>9. Limitation of Liability<br>Bringmart is not liable for any damages, injuries, or losses incurred while performing deliveries. As an independent contractor, you assume all risks associated with delivery activities. You are responsible for obtaining appropriate insurance coverage for yourself and your vehicle.<br>10. Indemnification<br>You agree to indemnify and hold Bringmart harmless from any claims, damages, losses, or expenses arising from your use of the app, your delivery activities, or your violation of these terms or applicable laws.<br>11. Intellectual Property<br>All content, trademarks, logos, and intellectual property in the Bringmart app are owned by Bringmart. You may not use, copy, or distribute any of our intellectual property without prior written permission.<br>12. Dispute Resolution<br>Any disputes arising from these terms or your use of the app will be resolved through arbitration in accordance with the laws of India. The arbitration will be conducted in the jurisdiction where Bringmart\'s main office is located.<br>13. Changes to Terms<br>Bringmart reserves the right to modify these Terms and Conditions at any time. We will notify you of significant changes through the app or via email. Your continued use of the app after changes constitutes acceptance of the updated terms.<br>14. Governing Law<br>These Terms and Conditions are governed by the laws of India. Any legal proceedings will be conducted in the courts of the jurisdiction where Bringmart\'s registered office is located.</p>'),
