INSERT INTO `sms_templates` (`id`, `title`, `message`, `type`, `created_at`, `updated_at`) VALUES
(1, 'Your Order Has Been Placed - Order #{order.id}', 'Dear [Customer Name], your order #[Order ID] has been successfully placed. You will receive updates as your order is processed. Thank you for shopping with us!', 'customer_place_order', '2024-11-20 11:55:59', NULL),
(2, 'Payment Pending for Order #{order.id}', 'Dear [Customer Name], your order [Order ID] is awaiting payment. Please complete the payment to process your order. If you need assistance, contact [Support Contact].', 'customer_order_payment_pending', '2024-11-20 11:55:59', NULL),
(3, 'Your Order Has Been Received - Order #{order.id}', 'Dear [Customer Name], we have received your order [Order ID] and it\'s now being processed. You will receive updates on shipping soon. Thank you for choosing [Store Name]!', 'customer_order_received', '2024-11-20 11:55:59', NULL),
(4, 'Your Order Has Been Processed - Order #{order.id}', 'Dear [Customer Name], your order [Order ID] has been processed and is ready for shipment. You will be notified once it\'s on the way. Thank you for shopping with us!', 'customer_order_processed', '2024-11-20 11:55:59', NULL),
(5, 'Your Order Has Been Shipped - Order #{order.id}', 'Dear [Customer Name], your order [Order ID] has been shipped. Thank you for choosing [Store Name]!', 'customer_order_shipped', '2024-11-20 11:55:59', NULL),
(6, 'Your Order is Out for Delivery - Order #{order.id}', 'Dear [Customer Name], your order [Order ID] is out for delivery and will reach you soon. Please be available to receive your package. Thank you!', 'customer_order_out_for_delivery', '2024-11-20 11:55:59', NULL),
(7, 'Your Order Has Been Delivered - Order #{order.id}', 'Dear [Customer Name], your order [Order ID] has been successfully delivered. We hope you enjoy your purchase. Thank you for shopping at [Store Name]!', 'customer_order_delivered', '2024-11-20 11:55:59', NULL),
(8, 'Your Order Has Been Cancelled - Order #{order.id}', 'Dear [Customer Name], your order Item [Product Name] from Order [Order ID] has been cancelled. If you have any questions or wish to place a new order, please contact [Support Contact].', 'customer_order_cancelled', '2024-11-20 11:55:59', NULL),
(9, 'Return Request Received for Order #{order.id}', 'Dear [Customer Name], we have received your return request for order Item [Product Name] from Order [Order ID]. Our team will review it and get back to you shortly with the next steps.', 'customer_order_return_request', '2024-11-20 11:55:59', NULL),
(10, 'Return Request Approved - Order #{order.id}', 'Dear [Customer Name], your return request for order Item [Product Name] from Order [Order ID] has been approved. The refund amount will be credited to your wallet. Thank you!', 'customer_order_confirm_return_request', '2024-11-20 11:55:59', NULL),
