  `approved_by` int(11) DEFAULT NULL COMMENT 'Admin ID who approved',
  `approved_at` datetime DEFAULT NULL COMMENT 'Approval timestamp',
  `priority` int(11) NOT NULL DEFAULT 0 COMMENT 'Priority order for display (higher = shown first)',
  `image` varchar(191) DEFAULT NULL COMMENT 'Combo offer image',
  `banner_image` varchar(191) DEFAULT NULL COMMENT 'Banner image for promotion',
  `badge_text` varchar(191) DEFAULT NULL COMMENT 'Badge text like "HOT", "NEW", "LIMITED"',
  `badge_color` varchar(191) DEFAULT NULL COMMENT 'Badge color hex code',
  `max_usage_per_user` int(11) DEFAULT NULL COMMENT 'Maximum times a user can use this combo (null = unlimited)',
  `max_usage_per_day_per_user` int(11) DEFAULT NULL COMMENT 'Max usage per day per user',
  `total_usage_limit` int(11) DEFAULT NULL COMMENT 'Total usage limit across all users (null = unlimited)',
  `current_usage_count` int(11) NOT NULL DEFAULT 0 COMMENT 'Current usage count',
  `daily_usage_limit` int(11) DEFAULT NULL COMMENT 'Daily usage limit across all users',
  `current_daily_usage_count` int(11) NOT NULL DEFAULT 0 COMMENT 'Current daily usage count',
  `last_usage_reset_date` date DEFAULT NULL COMMENT 'Last date when daily usage was reset',
  `min_cart_value` decimal(11,2) DEFAULT NULL COMMENT 'Minimum cart value required',
  `max_cart_value` decimal(11,2) DEFAULT NULL COMMENT 'Maximum cart value allowed',
  `min_product_value` decimal(11,2) DEFAULT NULL COMMENT 'Minimum value of qualifying products',
  `stack_with_other_offers` tinyint(1) NOT NULL DEFAULT 0 COMMENT '1 = Can be combined with other offers, 0 = Cannot be combined',
  `stack_with_promo_codes` tinyint(1) NOT NULL DEFAULT 0 COMMENT '1 = Can be combined with promo codes',
  `apply_to_discounted_items` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1 = Apply to already discounted items, 0 = Only full price items',
  `apply_to_sale_items` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1 = Apply to sale items',
  `discount_applicable_on` varchar(50) NOT NULL DEFAULT 'combo_items' COMMENT 'combo_items, entire_cart, specific_items',
  `customer_segments` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Target customer segments [new, returning, vip, etc]' CHECK (json_valid(`customer_segments`)),
  `excluded_user_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'User IDs excluded from this offer' CHECK (json_valid(`excluded_user_ids`)),
  `included_user_ids` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'User IDs specifically included' CHECK (json_valid(`included_user_ids`)),
  `applicable_payment_methods` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Payment methods where combo applies [cod, online, wallet, etc]' CHECK (json_valid(`applicable_payment_methods`)),
  `views_count` int(11) NOT NULL DEFAULT 0 COMMENT 'Number of times combo was viewed',
  `clicks_count` int(11) NOT NULL DEFAULT 0 COMMENT 'Number of times combo was clicked',
  `conversions_count` int(11) NOT NULL DEFAULT 0 COMMENT 'Number of times combo was used',
  `total_discount_given` decimal(11,2) NOT NULL DEFAULT 0.00 COMMENT 'Total discount amount given',
  `total_revenue_generated` decimal(11,2) NOT NULL DEFAULT 0.00 COMMENT 'Total revenue from combo orders',
  `metadata` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Additional flexible data storage' CHECK (json_valid(`metadata`)),
  `terms_conditions` text DEFAULT NULL COMMENT 'Terms and conditions for the combo',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL
